import React from "react";

const SidebarItem = ( {icon, title, minimized, setMinimized, activeComponent, setActiveComponent }) => {
  return (
    <div>
      <div className="flex flex-row items-center space-x-2 p-2 text-black rounded-md hover:bg-gray-200 hover:text-blue-600 duration-150 cursor-pointer">
        <span class="material-symbols-outlined">{icon}</span>
        {!minimized ? <span>{title}</span> : null}
      </div>
    </div>
  );
};

export default SidebarItem;
